import {Container, Row, Col, Bottom} from 'reactstrap';
import {Link} from 'react-router-dom';
import '../styles/thank-you.css'


const ThankYou = () => {
    return <section>
        <Container>
            <Row>
                <Col lg='12' >
                    <div className="thank-you">

                    </div>
                </Col>
            </Row>
        </Container>

    </section>
};

export default ThankYou;
